            <React.Fragment>
                <tr>
                    <th scope="row">movie number {movieId+1}</th>
                    <td>{movieId}</td>
                    <td>{movieName}</td>
                    <td>{movieGenre}</td>
                    <td>{movieRating}</td>
                    <td><i class="fa-regular fa-heart" onClick={()=>fullheart()}></i></td>
                    <td><button onClick={()=>delmovie()} >Delete</button></td>
                </tr>
            </React.Fragment>
        );
}
export default Movie1;
